// ResumeList.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const ResumeList = () => {
  const [resumes, setResumes] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetchResumes();
  }, []);

  const fetchResumes = async () => {
    try {
      const response = await axios.get('/api/resumes');
      setResumes(response.data);
    } catch (error) {
      console.error("Error fetching resumes", error);
    }
  };

  const createResume = async () => {
    try {
      const response = await axios.post('/api/resumes');
      setResumes([...resumes, response.data]);
      navigate(`/resumes/${response.data.id}`);
    } catch (error) {
      console.error("Error creating resume", error);
    }
  };

  const deleteResume = async (id) => {
    try {
      await axios.delete(`/api/resumes/${id}`);
      setResumes(resumes.filter(resume => resume.id !== id));
    } catch (error) {
      console.error("Error deleting resume", error);
    }
  };

  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <button onClick={createResume} style={{ fontSize: '20px', padding: '10px 20px' }}>+</button>
      <div>
        {resumes.map(resume => (
          <div key={resume.id} style={{ margin: '10px' }}>
            <button onClick={() => navigate(`/resumes/${resume.id}`)}>Resume {resume.id}</button>
            <button onClick={() => deleteResume(resume.id)}>X</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ResumeList;
